import '../CharacterPart.css';
//import eyesData from '../assets/eyes';
//import hairData from '../assets/hair';
//import lipsData from '../assets/lips';
//import handsData from '../assets/hands';

const CharacterPart = () => {
    const eyesImage = `${process.env.PUBLIC_URL}/assets/eyes/Angry.png`;
    const lipsImage = `${process.env.PUBLIC_URL}/assets/lips/Angry.png`;
    return (
    <section className="person">
        <div className= "profileWrapper">
            <div  className="headFixed">
                <div className="eyesWrapper">
                    <img className="eyes" src={eyesImage} alt="eyes"/>
                </div>
                <div className="lipsWrapper">
                    <img className="lips" src={lipsImage} alt="lips" />
                </div>
            </div>
            <div className='bodyFixed'>
            </div>
        </div>
    </section>
    )
}

export { CharacterPart };
